import React from 'react';
import './Footer.scss'

class Footer extends React.Component {
    render(){
        return(
            <footer>
                    <h2>Explore</h2>
                    <ul className="footer-list">
                        <li className="footer-list-item">Get Started</li>
                        <li className="footer-list-item">Help Guide</li>
                        <li className="footer-list-item">About</li>
                    </ul>
                <a className="footer-portfolio-link" href="https://www.lewharris.co.uk" target="_blank">Designed and Developed by www.lewharris.co.uk</a>
            </footer>
        )
    }
}

export default Footer;
